import { Link } from "react-router-dom";
import logoJpg from "../logo.jpg";

function Header({ activeLink, setActiveLink }) {
  return (
    <header className="header">
      <div>
        <Link to="#">
          <img className="logo" src={logoJpg} alt="Logo" />
        </Link>
      </div>

      <div className="main-menu">
        <ul className="links-list">
          {linksList.map((link) => (
            <li key={link.id}>
              <Link
                className={activeLink === link.text ? "active" : ""}
                to={link.url}
                onClick={() => {
                  setActiveLink(link.text);
                }}
              >
                {link.text}
              </Link>
            </li>
          ))}
        </ul>
      </div>
    </header>
  );
}

export default Header;
